(236, '1212183886538526720', '2021-07-17 09:19:23', 'KENYATAAN MEDIA\n\nYB TUAN VIDYANANTHAN A/L RAMANADHAN,\nPENGERUSI JAWATANKUASA KESIHATAN DAN ALAM SEKITAR NEGERI JOHOR\n\nSITUASI SEMASA COVID-19 DAN STATUS PROGRAM IMUNISASI COVID-19\n\n17 JULAI 2021 https://t.co/lkXIp9V1uf'),
(237, '1316893876586606593', '2021-07-17 09:19:04', 'Panglima TNI &amp; Kapolri melakukan pengecekan Posko PPKM dan bakti sosial kepada warga yang terdampak pandemi covid-19 di Kelurahan Tembalang kota Semarang. \n=====================================\nPolda Jawa Tengah\n\n#IngatPesanIbu #5M \n#PrayFromHome https://t.co/7QZ2yeMIJk'),
(238, '1391895094656004098', '2021-07-17 09:19:03', 'Dg adanya COVID-19, kita bisa melihat mana yang mengayomi masyarakat dan mana yang mendzholimi masyarakat\n\n#SalahLangkahPPKMDarurat'),
(239, '944798381611683840', '2021-07-17 09:18:59', 'Percepatan Penanganan Covid-19, Kapolres Probolinggo Tinjau Giat Vaksinasi di Gerai Vaksin TNI-POLRI.\n#GeraiVaksinTNIPolri\n#TaatiPPKMDarurat\n#LangkahCepatPolri\n#PPKMDarurat\n#PolriPresisi\n#PolresProbolinggo\n@humaspoldajatim\n@divisihumaspolri\n@kemenpanrb \n\nhttps://t.co/xJYiceQ16q'),
(240, '546938800', '2021-07-17 09:18:57', '@RSyaqiey Taktahu lah bang macam mana dia dapat, tapi apa saya tahu. Dia dah ambil vaksin akan ambil masa dalam 2-3 minggu untuk hasilkan antibodi untuk melawan covid-19. Mungkin dalam masa penghasilan tu, antibodi jadi lemah. So mungkin time tu dia mudah terdedah kepada covid. Hehe'),
(241, '1353957662367522816', '2021-07-17 09:18:56', 'Personil Polsek Tebing Tinggi, \nDi Puskesmas Paya Lombang  Ds. Paya Lombang Kec. Tebing Tinggi Kab. Serdang Bedagai\n\nMelakukan monitoring dan Pengamanan Pelaksanaan Vaksinasi Covid 19 Dosis tahap II bagi *Lanjut Usia/Lansia* di Wilkum Polsek Tebing Tinggi https://t.co/bYXG20nZrr'),
(242, '68930552', '2021-07-17 09:18:56', 'Mundurnya Irene Sukandar dan Medina Warda dari Piala Dunia Catur 2021, setelah langkah GM Susanto Megaranto yang terhenti akibat positif covid-19.  https://t.co/xyyHeRaU4q'),
(243, '42199532', '2021-07-17 09:18:56', 'Keputusan itu dibuat setelah mengambil kira situasi semasa pandemik Covid-19 serta perbincangan bersama Kementerian Kesihatan Malaysia (KKM) dan Majlis Keselamatan Negara (MKN). https://t.co/zMuCpXnP5i'),
(244, '1000337586', '2021-07-17 09:18:55', '[Video] COVID-19 | Kes Harian Diunjur Turun Pada November https://t.co/2NLVdc9S0e https://t.co/O9GDk5bdK7'),
(245, '1681014163', '2021-07-17 09:18:51', 'Hari ini dapat kabar klo 2 org tetangga di Malang meninggal  karena covid. Keduanya belum lama divaksin, jd meninggalnya setelah divaksin.\n\nSebaiknya vaksinasi dihentikan dulu, lakukan analisa krn kematian pasca vaksin semakin banyak.'),
(246, '971586469738381312', '2021-07-17 09:18:50', '17. \"Jika tidak menyadari bahwa prokes adalah menjadi yang utama, penanganan Covid-19 ya tidak berhasil,\" katanya. #AyoDisiplinPPKM\nhttps://t.co/yLaNBRovLg'),
(247, '971586469738381312', '2021-07-17 09:18:49', '16. Muhadjir menjelaskan, apapun istilah yang digunakan, baik PPKM Darurat atau PPKM super darurat, selama masyarakat melanggar protokol kesehatan, maka penanganan Covid-19 tidak akan berhasil. #AyoDisiplinPPKM\nhttps://t.co/9b6lYrfKfq'),
(248, '971586469738381312', '2021-07-17 09:18:49', '15. Pada data yang sama, Satgas juga mencatat pasien Covid-19 yang sembuh bertambah 28.079 orang. Sehingga, jumlah pasien yang sembuh dari Covid-19 kini berjumlah 2.204.491 orang. #AyoDisiplinPPKM\nhttps://t.co/bAyY9vJPRw'),
(249, '971586469738381312', '2021-07-17 09:18:49', 'Kasus aktif adalah jumlah pasien positif Covid-19 yang masih menjalani perawatan di rumah sakit atau isolasi mandiri. #AyoDisiplinPPKM\nhttps://t.co/BZ3Tc72xTW'),
(250, '971586469738381312', '2021-07-17 09:18:48', '14. Sementara, jumlah kasus aktif bertambah 24.716 pasien dibanding hari sebelumnya, sehingga kasus aktif Covid-19 kini mencapai 504.915 orang. #AyoDisiplinPPKM\nhttps://t.co/BZ3Tc72xTW');
